let encode = (file)=>{

var reader = new FileReader();
reader.onloadend = ()=>{
    return reader.result;
}

return reader.readAsDataURL(file)

    
}

let proxy = 'http://192.168.40.88:4000/';

let apiGet = (url)=>{
    return fetch(proxy+url , {
        method: 'get'
    })
    .then(res => res.json())
    .then(data =>{
        return data
    })
}

let apiGet1 = (url , params1)=>{
    return fetch(proxy+url+'/'+params1 , {
        method: 'get'
    })
    .then(res => res.json())
    .then(data =>{
        return data
    })
}

let apiGet2 = (url , params1 , params2)=>{
    return fetch(proxy+url+'/'+params1+'/'+params2 , {
        method: 'get'
    })
    .then(res => res.json())
    .then(data =>{
        return data
    })
}


let apiPostFormdata = (url , data)=>{
    return fetch(proxy+url,{
        method: 'post',
        body: data
    })
    .then(res => res.json())
    .then(data =>{
        return data;
    })
}


let apiPostJson = (url , data)=>{
    return fetch(proxy+url,{
        method: 'post',
        headers: { 'Content-Type':'application/json'},
        body: JSON.stringify(data)
    })
    .then(res => res.json())
    .then(data =>{
        return data;
    })
}

let test = (msq) =>{
    console.log(msq)
}


export default { encode , proxy , apiGet , apiGet1 , apiGet2 ,apiPostJson ,apiPostFormdata , msq}
